import { useEffect, useState } from 'react'
import Head from 'next/head'
import Header from '../components/header'
import AdPost from '../components/adpost'
import Headlines from '../components/headlines'

const client = require('contentful').createClient({
  space: process.env.NEXT_PUBLIC_CONTENTFUL_SPACE_ID,
  accessToken: process.env.NEXT_PUBLIC_CONTENTFUL_ACCESS_TOKEN
})

function HomePage() {
  async function fetchNews() {
    const entries = await client.getEntries({ content_type: "post" })
    if (entries.items) return entries.items
    console.log(`Error getting Entries for ${contentType.name}.`)
  }

  async function fetchAds() {
    const entries = await client.getEntries({ content_type: "addPost" })
    if (entries.items) return entries.items
    console.log(`Error getting Entries for ${contentType.name}.`)
  }

  const [posts, setPosts] = useState([])
  const [ads, setAds] = useState([])

  useEffect(() => {
    async function getPosts() {
      const allPosts = await fetchNews()
      setPosts([...allPosts])
      console.log(allPosts);
      const allAds = await fetchAds()
      setAds([...allAds])
      console.log(allAds);
    }
    getPosts()
  }, [])

  return (
    <>
      <Header />
      <div className="container">
      <div className="row">
      <div className="col-md-6 col-lg-4 mt-3">
      <div>
      {ads.length > 0
        ? <AdPost
            image = {ads[0].fields.adPost.fields}
            link = {ads[0].fields.link}
          /> : null
      }
      </div>
      <div className="mt-3">
      <h5 className="bg-light">Top Stories</h5>
      {posts.length > 0
        ? posts.map(p => (
            <Headlines
              date={p.fields.date}
              key={p.fields.title}
              image={p.fields.image.fields}
              title={p.fields.title}
              slug={p.fields.slug}
            />
          ))
        : null}
        </div>
        </div>
        <div className="col-md-6 col-lg-4 mt-3">
          <div>
          {ads.length > 1
            ? <AdPost
                image = {ads[1].fields.adPost.fields}
                link = {ads[1].fields.link}
              /> : null
          }
          </div>
          <div className="mt-3">
          <h5 className="bg-light">Big News</h5>
          {posts.length > 0
            ? posts.map(p => (
              <Headlines
                date={p.fields.date}
                key={p.fields.title}
                image={p.fields.image.fields}
                title={p.fields.title}
                slug={p.fields.slug}
              />
              ))
            : null}
            </div>
          </div>
            <div className="col-md-6 col-lg-4 mt-3">
              <div>
              {ads.length > 2
                ? <AdPost
                    image = {ads[2].fields.adPost.fields}
                    link = {ads[2].fields.link}
                  /> : null
              }
              </div>
              <div className="mt-3">
              <h5 className="bg-light">Trending</h5>
              {posts.length > 0
                ? posts.map(p => (
                  <Headlines
                    date={p.fields.date}
                    key={p.fields.title}
                    image={p.fields.image.fields}
                    title={p.fields.title}
                    slug={p.fields.slug}
                  />
                  ))
                : null}
                </div>
              </div>
            </div>
        </div>
    </>
  )
}

export default HomePage
